import React, { useState } from 'react';
import Axios from 'axios';
function ApplicantForm()
{


       const url="http://127.0.0.1:8000/api/apply/";
       const [data,setData]=useState({
            Name:"Yukn",
    FName:"Sar",
    Gender:"Male",
    DOB:"2002-04-04",
    Age:"18",
    Category:"ABC",
    Ward:"EKV",
    SubDistrict:"Erode",
    District:"Erode",
    State:"Tamilnadu",

    Pincode:"123456", 

    Mobile:"9087654321",
    AadharNo:"123456789012",
    Disablity:"No",
    DisabilityType:"None",
    BPL_Family_ID:"ded",
    BankDetails:"Nothin",
    IGNOAPS:"Yes",
    IGNWPS:"Yes",
    IGNDPS:"Yes",
    NFBS:"Yes"
        });






   const handleSubmit=(e)=>
    {
        e.preventDefault();

        console.log(data);
        // Axios.post(this.url,this.data).then(res=>{
        //     console.log(res.data);
        // })
    }
    const handleChange=(e)=>{
        setData({...data,[e.target.id]:[e.target.value]})
    }
    // handleChange(e) {
    //     //this.setState({Name: e.target.value});
    //     const newdata=(...data)=>newdata[e.target.id]=e.target.value;
    //     this.setState({.target.value})
    //   }

    // function handle(e)
    // {
    //   const newdata=(...data)=>
    //   newdata[e.target.id]=e.target.value
    //   setData(newdata)
    //   console.log(newdata)
    // }

        return(
        <div>
          <form onSubmit={handleSubmit}>
                <input  onChange={handleChange} id="Name" value={data.Name} placeholder='Name' type="text"></input>
                <input onChange={handleChange} id="Fname" value={data.FName} placeholder='Fname' type='text'></input>
                <input onChange={handleChange} id="Gender" value={data.Gender} placeholder='Gender' type='text'></input>
                <input onChange={handleChange} id="DOB'" value={data.DOB} placeholder='DOB' type='text'></input>
                <input onChange={handleChange} id="Age" value={data.Age} placeholder='Age' type='number'></input>
                <input onChange={handleChange} id="Category" value={data.Category} placeholder='Category' type='text'></input>
                <input onChange={handleChange} id="Ward" value={data.Ward} placeholder='Ward' type='text'></input>
                <input onChange={handleChange} id="SubDistrict" value={data.SubDistrict} placeholder='SubDistrict' type='text'></input>
                <input onChange={handleChange} id="District" value={data.District} placeholder='District' type='text'></input>
                <input onChange={handleChange} id="State" value={data.State} placeholder='State' type='text'></input>
                <input onChange={handleChange} id="Pincode" value={data.Pincode} placeholder='Pincode' type='number'></input>
                <input onChange={handleChange} id="Mobile" value={data.Mobile} placeholder='Mobile' type='number'></input>
                <input onChange={handleChange} id="AadharNo" value={data.AadharNo} placeholder='AadharNo' type='number'></input>
                <input onChange={handleChange} id="Disability" value={data.Disablity} placeholder='Disability' type='text'></input>
                <input onChange={handleChange} id="DisabilityType" value={data.DisabilityType} placeholder='DisabilityType' type='text'></input>
                <input onChange={handleChange} id="BPL_Family_ID" value={data.BPL_Family_ID} placeholder='BPL_Family_ID' type='text'></input>
                <input onChange={handleChange} id="BankDetails" value={data.BankDetails} placeholder='BankDetails' type='text'></input>
                <input onChange={handleChange} id="IGNOAPS" value={data.IGNOAPS} placeholder='IGNOAPS' type='text'></input>
                <input onChange={handleChange} id="IGNWPS" value={data.IGNWPS} placeholder='IGNWPS' type='text'></input>
                <input onChange={handleChange} id="IGNDPS" value={data.IGNDPS} placeholder='IGNDPS' type='text'></input>
                <input onChange={handleChange} id="NFBS" value={data.NFBS} placeholder='NFBS' type='text'></input>
                <input type="submit" value="Submit" />

          </form>





    </div>);


}
export default ApplicantForm;
